<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>La bourse de coopération internationale entre la Côte d'Ivoire et la Tunisie permet à un étudiant Ivoirien de réaliser un projet d'Etudes ou de Formations en Tunisie moyennant une bourse d'études. Cette bourse d'études peut être demandée par tout nouveau bachelier ou tout étudiant ivoirien en première année d'études universitaires.<br><br></div>
</div>
