</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="prendre-les-informations_bourse-de-cooperation-internationale" href="#prendre-les-informations">Bourse de coopération internationale</a>
</h2><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">&nbsp;Nous notons qu'il s'agit d'une bourse de coopération internationale entre la Côte d'Ivoire et la Tunisie.&nbsp;</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="prendre-les-informations_date-de-la-reunion-d-information" href="#prendre-les-informations">Date de la réunion d'information</a>
</h2><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Nous notons la date de la réunion d'information (14 octobre) au ministère des affaires étrangères de la Côte d'Ivoire pour les candidats admis à la Bourse-Tunisie.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="prendre-les-informations_date-de-depart" href="#prendre-les-informations">Date de départ</a>
</h2><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Nous notons la date de départ (21 octobre) pour la Tunisie.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="prendre-les-informations_date-d-arrivee-" href="#prendre-les-informations">Date d'arrivée&nbsp;</a>
</h2><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Nous notons la date d'arrivée (22 octobre) en Tunisie.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="prendre-les-informations_montant-des-depenses-personnelles" href="#prendre-les-informations">Montant des&nbsp;dépenses personnelles</a>
</h2><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Nous notons que nous devrons prévoir un montant de (500 Euros soit 328.000 FCFA) pour faire face aux premières dépenses personnelles en Tunisie.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="prendre-les-informations_montant-de-la-bourse-d-etudes" href="#prendre-les-informations">Montant de la bourse d'études</a>
</h2>&nbsp;<br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Nous notons que nous recevrons un montant de (83.000 FCFA/trimestre soit 27.600 FCFA/mois) pour la bourse d'études en Tunisie.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="prendre-les-informations_montant-de-l-aide-familiale--facultative-" href="#prendre-les-informations">Montant de l'aide familiale (facultative)</a>
</h2><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Nous notons que nos parents devrons nous envoyer un montant de (50.000 FCFA/mois) pour vivre aisément en résidence universitaire en Tunisie.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="prendre-les-informations_liste-des-candidats-admins" href="#prendre-les-informations">Liste des candidats admins</a>
</h2><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Nous notons le lien pour télécharger le résultat de la liste des candidats admins à la Bourse-Tunisie.</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
